import React from 'react';
import styled from 'styled-components/native';

import { TouchableOpacity, StyleSheet, Image, View , Text} from 'react-native';
import { Feather } from '@expo/vector-icons';

import Photo1 from '../assets/baby1.jpg'

const ExploreArticle = ({ navigation }) => {

    return (
        <>
            <Main>

                <OverlayContainer>
                    <OverlayIconArea>
                    <TouchableOpacity onPress={() => navigation.navigate('Explore')}>
                            <Image source={Photo1} style={styles.photo} />
                            <OverlayIcon>
                        <Feather name="arrow-left" size={30} color="white" />
                        </OverlayIcon>
                        </TouchableOpacity>
                        </OverlayIconArea>



                        <OverlayTextArea> Hur ska man börja?
                    </OverlayTextArea>

                    </OverlayContainer>

            </Main>

        </>
    )
}

const styles = StyleSheet.create({
        photo: {
        height: 300,
        width: 375,
        shadowColor: '#202020',
        shadowOffset: { width: 0, height: 2 },
        shadowRadius: 2,
    },


})



const Main = styled.View`
flex: 1;
background-color:#5A673E;
`
const OverlayContainer = styled.View`

`
const OverlayIconArea = styled.View`

`
const OverlayIcon = styled.View`
postion: absolute;
`

const OverlayTextArea = styled.View`

`


export default ExploreArticle;

